content:
罗通社10月23日报道，欧盟统计局发布的数据显示，今年前7个月，罗马尼亚笔记本电脑进口量比去年同期增长了38%，增幅居欧盟首位。欧盟国家中，仅罗马尼亚(38%)和丹麦(35%)的笔记本电脑进口增幅超过30%。其余成员国中，有9个国家的笔记本电脑进口量增幅在20%至30%之间，9个增幅在10%至20%之间，6个增幅在2%至10%之间，爱沙尼亚的笔记本电脑进口量略有下降。
